import axios from 'axios';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Addplayer() {
  let navigate=useNavigate()
    const [player, setPlayer] = useState({
        playerid: "",
        playername: "",
        teamid: "",
        age: "",
        role: ""
    });

    const {playerid, playername, teamid, age,role } = player;

    const onInputChange = (e) => {
        setPlayer({ ...player, [e.target.name]: e.target.value });
    };

    const onSubmit =async (e) => {
        e.preventDefault();
        // Add your form submission logic here, e.g., sending data to an API
        await axios.post("http://localhost:8080/player",player)
        navigate("/");//to navigate to home after submitting
    };

    return (
        <form onSubmit={(e)=> onSubmit(e)}>
            <div className="row g-3">
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Player id"
                        name="playerid"
                        value={playerid}
                        onChange={onInputChange}
                        aria-label="Player id"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Player name"
                        name="playername"
                        value={playername}
                        onChange={onInputChange}
                        aria-label="Player name"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Team_id"
                        name="teamid"
                        value={teamid}
                        onChange={onInputChange}
                        aria-label="Team_id"
                    />
                </div>
                <div className="col-sm">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="age"
                        name="age"
                        value={age}
                        onChange={onInputChange}
                        aria-label="age"
                    />
                </div>
                <div className="col-sm">
                <select
            className="form-select"
            name="role"
            value={role}
            onChange={onInputChange}
          >
            <option value="">Choose...</option>
            <option value="Bengaluru">Batter</option>
            <option value="Mumbai">Bowler</option>
            <option value="Chennai">Allrounder</option>
          </select>
                </div>
                <div className="col-auto">
                    <button type="submit" className="btn btn-outline-danger mt-2">Submit</button>
                </div>
            </div>
        </form>
    );
}
